import React, { useState } from "react";
import Slider from "rc-slider";
import "rc-slider/assets/index.css";
import "./reng.css";

function Reng() {
  const [values, setValues] = useState([15000, 45000]);

  const handleSliderChange = (newValues) => {
    setValues(newValues);
  };

  return (
    <div>
      <div className="value">
        <div>
          <div> От:</div>
          <div>{values[0]},</div>
        </div>
        <div></div>
        <div>До:</div>
        <div>{values[1]},</div>
      </div>
      <Slider
        min={0}
        max={60000}
        step={15}
        value={values}
        onChange={handleSliderChange}
        range
      />
    </div>
  );
}
export default Reng;
